icial Intelligence Laboratory on unique data extraction and disk forensics. He served as a Board member at Rocketrip. He served as Board Member at Carmera.","Investment Focus":"Cyber Security, Blockchain","LinkedIn Profile":"https://www.linkedin.com/in/eriknordlander","Total Investments":"3","Preferred Geography":"United States","Number of Investments":"3"}'::jsonb) ON CONFLICT (id) DO UPDATE SET first_name = EXCLUDED.first_name, last_name = EXCLUDED.last_name, email = EXCLUDED.email, title = EXCLUDED.title, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, is_active = EXCLUDED.is_active, created_at = EXCLUDED.created_at, updated_at = EXCLUDED.updated_at, folk_id = EXCLUDED.folk_id, source = EXCLUDED.source, folk_workspace_id = EXCLUDED.folk_workspace_id, folk_list_ids = EXCLUDED.folk_list_ids, folk_updated_at = EXCLUDED.folk_updated_at, investor_type = EXCLUDED.investor_type, folk_custom_fields = EXCLUDED.folk_custom_fields;
