I, ROLM Corp., Alibaba, Ironwood Pharmaceuticals, and Ultragenyx. Today, F-Prime''s funds are larger and more global, but its teams are still small and local. F-Prime stays true to its entrepreneurial roots. In the US and Europe, F-Prime Capital Partners is investing in healthcare (formerly Fidelity Biosciences) and in technology (formerly part of Devonshire Investors). In other geographies, its sister fund is called Eight Roads (formerly Fidelity Growth Partners), with investment teams in London, Shanghai, Beijing, Hong Kong, Tokyo, and Mumbai. Together F-Prime brings a world of insight, domain expertise and relationships to support entrepreneurs. Without the pressure of fundraising from outside investors, F-Prime Capital Partners focuses all of its time finding and helping great entrepreneurs build important companies.","Investment Focus":"Health Care, Biotechnology, Pharmaceutical","LinkedIn Profile":"https://www.linkedin.com/in/jonplim96/","Total Investments":"323","Investor''s Country":"United States","Preferred Geography":"Global","Number of Investments":"323"}'::jsonb) ON CONFLICT (id) DO UPDATE SET first_name = EXCLUDED.first_name, last_name = EXCLUDED.last_name, email = EXCLUDED.email, title = EXCLUDED.title, linkedin_url = EXCLUDED.linkedin_url, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, is_active = EXCLUDED.is_active, created_at = EXCLUDED.created_at, updated_at = EXCLUDED.updated_at, folk_id = EXCLUDED.folk_id, source = EXCLUDED.source, folk_workspace_id = EXCLUDED.folk_workspace_id, folk_list_ids = EXCLUDED.folk_list_ids, folk_updated_at = EXCLUDED.folk_updated_at, person_linkedin_url = EXCLUDED.person_linkedin_url, investor_type = EXCLUDED.investor_type, investor_state = EXCLUDED.investor_state, investor_country = EXCLUDED.investor_country, funding_stage = EXCLUDED.funding_stage, num_lead_investments = EXCLUDED.num_lead_investments, folk_custom_fields = EXCLUDED.folk_custom_fields;
